class ALAddendumField(DAObject) Object representing a single field and its attributes as related to whether it should be displayed in an addendum. Useful for PDF templates. The items can be strings or lists/list-like objects. It does not know how to handle overflow for a dictionary, e.g. Required attributes: field_name (str): represents the name of a docassemble variable overflow_trigger (int | bool): determines when text is cut off and sent to addendum Optional/planned (not implemented yet): headers->dict(attribute: display label for table) field_style->"list"|"table"|"string" (optional: defaults to "string") overflow_value def overflow_value(preserve_newlines: bool = False, input_width: int = 80, overflow_message: str = "", preserve_words: bool = True) Try to return just the portion of the variable (list-like object or string) that is not contained in the safe_value(). Whitespace will be altered. If preserve_newlines is true, the return value may have newlines, but double newlines and Windows style (
) will be replaced with 
. Double spaces will replaced with a single space. If preserve_newlines is false, all whitespace, including newlines and tabs, will be replaced with a single space. max_lines def max_lines(input_width: int = 80) -> int Calculate the number of lines of text that will fit in the specified input value def value() -> Any Return the full value, disregarding overflow. Could be useful in addendum if you want to show the whole value without making user flip back/forth between multiple pages. has_overflow def has_overflow(overflow_message: str = "", input_width: int = 80, preserve_newlines: bool = False, _original_value: Optional[str] = None, preserve_words: bool = True) -> bool Return True only if the value's length exceeds the overflow trigger. Arguments: overflow_message str - A short message to go on the page where text is cutoff. input_width int - The width, in characters, of the input box. Defaults to 80. preserve_newlines bool - Determines whether newlines are preserved in the "safe" text. Defaults to False, which means all newlines are removed. This allows more text to appear before being sent to the addendum. _original_value Any - for speed reasons, you can provide the full text and just use this method to determine if the overflow trigger is exceeded. If no _original_value is provided, this method will determine it using the value_if_defined() method. preserve_words bool - If True, the algorithm will try to preserve whole words when truncating the text. If False, the algorithm will truncate the text at the overflow trigger, regardless of whether it is in the middle of a word. original_or_overflow_message def original_or_overflow_message( overflow_message: str = "", input_width: int = 80, preserve_newlines: bool = False, _original_value: Optional[str] = None, preserve_words: bool = True) -> Union[str, List[Any]] Return the original value if it is less than the overflow trigger (once processed), otherwise return the overflow message. Unlike safe_value(), this will never output a partial value. Arguments: overflow_message str - A short message to go on the page where text is cutoff. input_width int - The width, in characters, of the input box. Defaults to 80. preserve_newlines bool - Determines whether newlines are preserved in the "safe" text. Defaults to False, which means all newlines are removed. This allows more text to appear before being sent to the addendum. _original_value Any - for speed reasons, you can provide the full text and just use this method to determine if the overflow trigger is exceeded. If no _original_value is provided, this method will determine it using the value_if_defined() method. preserve_words bool - If True, the algorithm will try to preserve whole words when truncating the text. If False, the algorithm will truncate the text at the overflow trigger, regardless of whether it is in the middle of a word. safe_value def safe_value(overflow_message: str = "", input_width: int = 80, preserve_newlines: bool = False, _original_value: Optional[str] = None, preserve_words: bool = True) -> Union[str, List[Any]] Return just the portion of the variable that heuristics suggest will fit in the specified overflow_trigger limit. If the value is not defined, return empty string. When preserve_newlines is True, the output will be limited to a number of lines, not a number of characters. The max number of lines will be calculated as floor(self.overflow_trigger/input_width). Therefore, it is important that input_width is a divisor of overflow_trigger. Whitespace will be altered. If preserve_newlines is true, the return value may have newlines, but double newlines and Windows style (
) will be replaced with 
. Double spaces will replaced with a single space. If preserve_newlines is false, all whitespace, including newlines and tabs, will be replaced with a single space. Arguments: overflow_message str - A short message to go on the page where text is cutoff. input_width int - The width, in characters, of the input box. Defaults to 80. preserve_newlines bool - Determines whether newlines are preserved in the "safe" text. Defaults to False, which means all newlines are removed. This allows more text to appear before being sent to the addendum. _original_value Any - for speed reasons, you can provide the full text and just use this method to determine if the overflow trigger is exceeded. If no _original_value is provided, this method will determine it using the value_if_defined() method. value_if_defined def value_if_defined() -> Any Return the value of the field if it is defined, otherwise return an empty string. Addendum should never trigger docassemble's variable gathering. columns def columns(skip_empty_attributes: bool = True, skip_attributes: set = {"complete"}) -> Optional[list] Return a list of the columns in this object. By default, skip empty attributes and the complete attribute. type def type() -> str list | object_list | other is_list def is_list() -> bool Identify whether the field is a list, whether of objects/dictionaries or just plain variables. is_object_list def is_object_list() -> bool Identify whether the field represents a list of either dictionaries or objects. overflow_markdown def overflow_markdown() -> str Return a formatted markdown table or bulleted list representing the values in the list. This method does not give you any control over the output other than labels of columns, but you also do not need to use this output if you want to independently control the format of the table. overflow_docx def overflow_docx( path: str = "docassemble.ALDocumentDict:data/templates/addendum_table.docx") Light wrapper around insert_docx_template() that inserts a formatted table into a docx file. If the object in the list is a plain string/int, it returns a bulleted list. Using this method will not give you any control at all over the formatting, but you can directly call field.overflow_value() instead of using this method.
